import React, { useState } from 'react';

import ButtonSmall from '../../UserInterface/Buttons/Button/ButtonSmall';
import ButtonLinkNotMouse from '../../UserInterface/Buttons/Button/ButtonLinkNotMouse';

function WarningValueNotSelected(props) {

    const [helper, setHelper] = useState(false);

    const hendlerButtonHelp = () => {
        setHelper(true);
    }

    return (

        <div className={props.classnameWarningValueNotSelected}>

            {
                helper ?
                    <div>
                        Для выбора значения:
                            <span class="fa fa-table" aria-hidden="true"> вернитесь в таблицу</span>
                            <span class="fa fa-search" aria-hidden="true"> выберите значение</span>
                        <span >кликните по строке левой кнопкой мыши</span>
                            <span class="fa fa-mouse-pointer" aria-hidden="true"> значение выбрано</span>
                        <span class="fa fa-hand-pointer-o" aria-hidden="true"> в консоли управления таблицей выберите действие</span>
                    </div>
                   :<div>
                        <p>
                            !!! ВНИМАНИЕ !!!
                        </p>
                        <p>
                            Действие не может быть призведено 
                        </p>
                        <p>
                            Выберите значение
                        </p>
                    </div>
            }

            <div >
                <ButtonLinkNotMouse
                    classname={props.classnameButtonWarningComeBack}
                    onclick={props.onclickWarning}
                    name='Назад'
                    to={props.to}
                />
                <ButtonSmall
                    classname={props.classnameButtonWarningHelp}
                    icon="fa fa-question"
                    onclick={hendlerButtonHelp}
                    />
            </div>

        </div>
      
    )
}

export default WarningValueNotSelected
